using System;
using System.Linq;
using System.IO;
using System.Text;
using System.Collections;
using System.Collections.Generic;

class Solution
{
    //Might consider going for ulong if Validators ask higher indexes later on
    //max usage: 2 880 067 194 370 816 120 / 9 223 372 036 854 775 807 (aka long)
    static List<long> save = new List<long>();
    static int l = 2;

    static void Main(string[] args)
    {
        save.Add(0);
        save.Add(1);
        int N = int.Parse(Console.ReadLine());
        string[] inputs = Console.ReadLine().Split(' ');
        for (int i = 0; i < N; i++)
            Console.WriteLine( f( int.Parse( inputs[i] ) ) );
    }

    static long f(int n){
        if(n >= l)
            for(; l <= n; l++)
                save.Add(save[l-1]+save[l-2]);
        else if(n < 0)
            return 0;
        return save[n];
    }
}
